import Link from 'next/link';

const StyledA = styled('a')`
  margin-right: 15px;
`;

const Header = () => {
  return (
    <div>
      <Link href='/'>
        <StyledA>Main</StyledA>
      </Link>
      <Link href='/about'>
        <StyledA>About</StyledA>
      </Link>
    </div>
  );
};

export default Header;
